import HighScoreCard from "./HighScoreCard";
import Scores from "./scores";

const HighScoreTable = () => {
    return (
        <div className = "table-box">
            <h1 className="h1">High Scores per Country</h1>
            <HighScoreCard />
        </div>
    )
}

export default HighScoreTable;
